import React from 'react';
import './LikesWeek.module.css';

const LikesWeek = () => {
  return (
    <div className='likes-week-block'>
      <div className='likes-week-title'>Наибольшее число лайков</div>
      {[...Array(10)].map((_, idx) => (
        <div key={idx} className='likes-week-row'>
          <div className='likes-week-number'>{idx+1}</div>
          <div className='likes-week-avatar'></div>
          <div className='vertical-column-container'>
            <div className='likes-week-novel-title'>Название новеллы</div>
            <div className='likes-week-novel-author'>Автор (страна)</div>
            <div className='likes-week-novel-genres'>Основные жанры</div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default LikesWeek;
